    public void reduzirVariancia(int mod) {
        for (int i = 0; i < x.length; i++) {
            if (x[i] == mod - 1 || x[i] == mod + 1 || x[i] == mod + 2 || x[i] == mod - 2) {
                x[i] = mod;
            }
            if (i < x.length - 5 && x[i] != mod && (x[i + 1] == mod || x[i + 2] == mod || x[i + 3] == mod || x[i + 4] == mod) && (x[i - 1] == mod || x[i - 2] == mod || x[i - 3] == mod || x[i - 4] == mod)) {
                x[i] = mod;
            }

//                System.out.println(x[i]);
        }
    }

