    public List<List<Integer>> quebrarComplex(int[] a, int mod, int tolerancia) {
        int padrao = a.length / 100;
        int cont = 0;
        int j = 0;
        List<String> listaAux = new ArrayList<>();
        List<List<Integer>> listaReal = new ArrayList<>();
        StringBuilder str = new StringBuilder();
        StringBuilder amostra = new StringBuilder();
        String amostraTemp;
        for (int i = 0; i < 100; i++) {
            if (a[i] != mod) {
                j = i;
                break;
            }
        }

        for (int i = j; i < a.length; i++) {
            amostra.append(String.valueOf(a[i]) + " ; ");
            if (a[i] >= mod + tolerancia || a[i] <= mod - tolerancia) {
                if (cont > padrao) {
                    listaAux.add(str.toString());
                }
                cont = 0;
                str = new StringBuilder();
            } else {
                cont++;
                str.append(String.valueOf(a[i]) + " ; ");
            }
        }
        amostraTemp = amostra.toString();
        for (String string : listaAux) {
            amostraTemp = amostraTemp.replace(string, "#");
//            System.out.println(string);
        }
        String[] strin = amostraTemp.split("#");
        for (String string : strin) {
            String[] numeros = string.split(" ; ");
            List<Integer> aux = new ArrayList<>();
            for (String r : numeros) {
                aux.add(Integer.valueOf(r));
            }
            listaReal.add(aux);
        }
        for (List<Integer> s : listaReal) {
            System.out.println("");
            for (Integer i : s) {
                System.out.print(i + " ; ");
            }
        }
        return listaReal;
    }

