    public List<List<Integer>> listasMesmoTamanho(List<List<Integer>> lista) {
        int[] listaIguais = new int[lista.size()];
        List<List<Integer>> aux = new ArrayList<>();
        aux = new ArrayList<>();
        for (int i = 0; i < lista.size(); i++) {
            listaIguais[i] = lista.get(i).size();
        }
        int tamanho = verificarModal(listaIguais);
        for (int i = 0; i < lista.size(); i++) {
            if (tamanho == lista.get(i).size()) {
                aux.add(lista.get(i));
            }
        }
        return aux;
    }

    public List<Integer> media(List<List<Integer>> lista) {
        List<Integer> aux = new ArrayList<>();
        int[] vetor = new int[lista.get(1).size()];
        for (int i = 0; i < lista.size(); i++) {
            for (int j = 0; j < lista.get(i).size(); j++) {
                vetor[j] += lista.get(i).get(j);
            }

        }
        for (int i : vetor) {
            aux.add(i / lista.size());
        }
        return aux;
    }
